import React, { useState } from "react";
import Layout from "../../../Layout/Layout";
import "./style.css";
import { useDispatch } from "react-redux";
import { createAgents } from "../Home/homeSlice";
import LoginModal from "../../../components/LoginModal";
export default function CreateUser() {
  const dispatch = useDispatch();
  const [Open, setOpen] = useState(false);
  const initialstate = {
    fullname: "",
    email: "",
    phone: "",
    password: "",
  };
  const [user, setUser] = useState(initialstate);
  const [agentList, setAgentList] = useState([]);
  console.log(
    "ğŸš€ ~ file: CreateUser.jsx:18 ~ CreateUser ~ agentList:",
    agentList
  );
  const handlechange = (e) => {
    const { name, value } = e.target;
    setUser((prestate) => ({
      ...prestate,
      [name]: value,
    }));
  };
  const handlesubmit = () => {
    const payload = {
      ...user,
    };
    // dispatch(createAgents(payload));
    setAgentList(payload);
    setUser(initialstate);
  };
  return (
    <div>
      <Layout setModal={setOpen}>
        <div className="create-user">
          <h2>Create Agents</h2>
          <div className="create">
          <input
          type="text"
          placeholder="Full Name"
          value={fullName}
          onChange={(e) => setFullName(e.target.value)}
        />
        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        <input
          type="tel"
          placeholder="Phone"
          value={phone}
          onChange={(e) => setPhone(e.target.value)}
        />
        <input
          type="password"
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />

            <button onClick={handlesubmit}>Create Agent</button>
          </div>
        </div>
        <div className="agentlist">
          <table>
            <tr>
              <th>Full Nmae</th>
              <th>Email Id</th>
              <th>Phone No</th>
              <th>Password</th>
              <th>Edit</th>
            </tr>
            <tr>
              {agentList && agentList.map((item) => (
                <div>
                  <td>{item.fullname}</td>
                  <td>{item.email}</td>
                  <td>{item.phone}</td>
                  <td>{item.password}</td>
                  <td>
                    <span class="material-symbols-outlined">edit</span>
                  </td>
                </div>
              ))}
            </tr>
          </table>
        </div>
        {Open && <LoginModal show={Open} setOpen={setOpen} />}
      </Layout>
    </div>
  );
}
